import React, { Component } from 'react'
import ItemList from './Merchant/ItemList/ItemList'
import CreateItem from './Merchant/CreateItem/CreateItem';
import EditForm from './Merchant Home/Edit/EditForm'
import EditContainer from './Merchant Home/Edit/EditContainer'
import OrderListContainer from './Merchant Home/AllOrders/OrderListContainer'
export default class UserSuperContainer extends Component {
    render() {
        return (
            <>
                    <ItemList />
                    <CreateItem />
                    <EditForm />
                    <EditContainer />
                    <OrderListContainer />
            </>
        )
    }
}
